const GetGameData = (instance) => {
    const opponent = "";
    if(instance.g.vls.ta === 'HOU') {
        opponent = instance.vls.tn;
        const dataCached = true;
    }
    else{
        const opponent = (instance.g.hls.tn);
        const dataCached = true;
    }

    const GameData = {
        'date': instance.gdte,
        'time': instance.utctm,
        'city': instance.ac,
        'state': instance.as,
        'opponent': opponent,
        'status': instance.st
    };
    return GameData;
}

export default GetGameData;
